import './video.css'


function Video({title}){
    return(
        <>
        <img className='photo' alt='sample' src='https://www.simplilearn.com/ice9/free_resources_article_thumb/what_is_image_Processing.jpg'></img>
        <div className='dark' >{title} Video</div>
        </>
    )
}



export default Video;
